    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "\u0391\u03bd \u03b1\u03c6\u03ae\u03c3\u03b5\u03c4\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c7\u03c9\u03c1\u03af\u03c2 \u03bd\u03b1 \u03c3\u03ce\u03c3\u03b5\u03c4\u03b5 \u03ae \u03bd\u03b1 \u03c5\u03c0\u03bf\u03b2\u03ac\u03bb\u03b5\u03c4\u03b5 \u03c4\u03b7\u03bd \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u03c3\u03b1\u03c2, \u03b8\u03b1 \u03c7\u03ac\u03c3\u03b5\u03c4\u03b5 \u03bf\u03c0\u03bf\u03b9\u03b1\u03b4\u03ae\u03c0\u03bf\u03c4\u03b5 \u03b1\u03bb\u03bb\u03b1\u03b3\u03ae \u03ad\u03c7\u03b5\u03c4\u03b5 \u03c0\u03c1\u03b1\u03b3\u03bc\u03b1\u03c4\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03b5\u03b9 \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ae.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "\u0391\u03bd \u03b5\u03b3\u03ba\u03b1\u03c4\u03b1\u03bb\u03b5\u03af\u03c8\u03b5\u03c4\u03b5 \u03c4\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c7\u03c9\u03c1\u03af\u03c2 \u03bd\u03b1 \u03c5\u03c0\u03bf\u03b2\u03ac\u03bb\u03b5\u03c4\u03b5 \u03c4\u03b9\u03c2 \u03b1\u03be\u03b9\u03bf\u03bb\u03bf\u03b3\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c3\u03b1\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf\u03c5\u03c2 \u03c3\u03c5\u03bc\u03c6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ad\u03c2 \u03c3\u03b1\u03c2, \u03b8\u03b1 \u03c7\u03ac\u03c3\u03b5\u03c4\u03b5 \u03bf\u03c0\u03bf\u03b9\u03b1\u03b4\u03ae\u03c0\u03bf\u03c4\u03b5 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u03ad\u03c7\u03b5\u03c4\u03b5 \u03ba\u03ac\u03bd\u03b5\u03b9.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "\u0391\u03bd \u03b1\u03c6\u03ae\u03c3\u03b5\u03c4\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c7\u03c9\u03c1\u03af\u03c2 \u03bd\u03b1 \u03c5\u03c0\u03bf\u03b2\u03ac\u03bb\u03b5\u03c4\u03b5 \u03c4\u03b7\u03bd \u03b1\u03c5\u03c4\u03bf\u03b1\u03be\u03b9\u03bf\u03bb\u03cc\u03b3\u03b7\u03c3\u03ae \u03c3\u03b1\u03c2, \u03b8\u03b1 \u03c7\u03ac\u03c3\u03b5\u03c4\u03b5 \u03bf\u03c0\u03bf\u03b9\u03b1\u03b4\u03ae\u03c0\u03bf\u03c4\u03b5 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u03ad\u03c7\u03b5\u03c4\u03b5 \u03ba\u03ac\u03bd\u03b5\u03b9.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "\u0391\u03bd \u03b5\u03b3\u03ba\u03b1\u03c4\u03b1\u03bb\u03b5\u03af\u03c8\u03b5\u03c4\u03b5 \u03c4\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03c7\u03c9\u03c1\u03af\u03c2 \u03bd\u03b1 \u03c5\u03c0\u03bf\u03b2\u03ac\u03bb\u03b5\u03c4\u03b5 \u03c4\u03b9\u03c2 \u03b1\u03be\u03b9\u03bf\u03bb\u03bf\u03b3\u03ae\u03c3\u03b5\u03b9\u03c2 \u03c3\u03b1\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf\u03c5\u03c2 \u03c3\u03c5\u03bc\u03c6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ad\u03c2 \u03c3\u03b1\u03c2, \u03b8\u03b1 \u03c7\u03ac\u03c3\u03b5\u03c4\u03b5 \u03bf\u03c0\u03bf\u03b9\u03b1\u03b4\u03ae\u03c0\u03bf\u03c4\u03b5 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u03ad\u03c7\u03b5\u03c4\u03b5 \u03ba\u03ac\u03bd\u03b5\u03b9.",
    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "N\u1ebfu b\u1ea1n r\u1eddi \u0111i, b\u1ea1n kh\u00f4ng th\u1ec3 \u0111\u0103ng b\u00e0i trong c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn c\u1ee7a nh\u00f3m n\u00e0y n\u1eefa. V\u1ecb tr\u00ed c\u1ee7a b\u1ea1n s\u1ebd d\u00e0nh cho ng\u01b0\u1eddi h\u1ecdc kh\u00e1c.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Trong tr\u01b0\u1eddng h\u1ee3p b\u1ea1n mu\u1ed1n t\u1ea1o ra nh\u1eefng thay \u0111\u1ed5i l\u1edbn, b\u1ea1n n\u00ean th\u00f4ng b\u00e1o tr\u01b0\u1edbc v\u1edbi c\u00e1c th\u00e0nh vi\u00ean c\u1ee7a nh\u00f3m v\u1ec1 nh\u1eefng thay \u0111\u1ed5i n\u00e0y.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "N\u1ebfu b\u1ea1n l\u00e0m cho %(xblockType)s n\u00e0y hi\u1ec3n th\u1ecb v\u1edbi ng\u01b0\u1eddi h\u1ecdc, ng\u01b0\u1eddi h\u1ecdc s\u1ebd c\u00f3 th\u1ec3 xem n\u1ed9i dung c\u1ee7a n\u00f3 sau ng\u00e0y ph\u00e1t h\u00e0nh v\u00e0 sau khi b\u1ea1n \u0111\u00e3 xu\u1ea5t b\u1ea3n \u0111\u01a1n v\u1ecb. Ch\u1ec9 c\u00f3 nh\u1eefng \u0111\u01a1n v\u1ecb \u1ea9n \u0111\u1ed1i v\u1edbi ng\u01b0\u1eddi h\u1ecdc s\u1ebd v\u1eabn \u1ea9n sau khi b\u1ea1n \u0111\u00e3 xo\u00e1 t\u00f9y ch\u1ecdn n\u00e0y cho %(xblockType)s.",
    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "N\u1ebfu ti\u1ebfp t\u1ee5c, b\u1ea1n s\u1ebd kh\u00f4ng th\u1ec3 s\u1eed d\u1ee5ng t\u00e0i kho\u1ea3n n\u00e0y \u0111\u1ec3 tham gia c\u00e1c kh\u00f3a h\u1ecdc tr\u00ean \u1ee9ng d\u1ee5ng {platformName} {siteName}, ho\u1eb7c b\u1ea5t k\u1ef3 trang web n\u00e0o kh\u00e1c do {platformName} l\u01b0u tr\u1eef.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "N\u1ebfu b\u1ea1n x\u00f3a b\u1ea3n ghi n\u00e0y, b\u1ea3n ghi s\u1ebd kh\u00f4ng kh\u1ea3 d\u1ee5ng cho b\u1ea5t k\u1ef3 th\u00e0nh ph\u1ea7n n\u00e0o s\u1eed d\u1ee5ng video n\u00e0y.",
    "If you remove this transcript, the transcript will not be available for this component.": "N\u1ebfu b\u1ea1n x\u00f3a b\u1ea3ng \u0111i\u1ec3m n\u00e0y, b\u1ea3ng \u0111i\u1ec3m s\u1ebd kh\u00f4ng kh\u1ea3 d\u1ee5ng cho th\u00e0nh ph\u1ea7n n\u00e0y.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "N\u1ebfu b\u1ea1n c\u1ea7n h\u1ed7 tr\u1ee3 ch\u1ee5p m\u1ed9t trong hai b\u1ee9c \u1ea3nh \u0111\u1ec3 g\u1eedi, h\u00e3y li\u00ean h\u1ec7 v\u1edbi b\u1ed9 %(platformName)s \u0111\u1ec3 c\u00f3 th\u00eam \u0111\u1ec1 xu\u1ea5t.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "N\u1ebfu b\u1ea1n ch\u1ecdn m\u1ed9t t\u00f9y ch\u1ecdn kh\u00e1c v\u1edbi \"%(hide_label)s\", nh\u1eefng \u0111\u01a1n v\u1ecb \u0111\u00e3 xu\u1ea5t b\u1ea3n trong ph\u1ea7n con n\u00e0y s\u1ebd su\u1ea5t hi\u1ec7n cho ng\u01b0\u1eddi h\u1ecdc tr\u1eeb khi ch\u00fang \u0111\u01b0\u1ee3c \u1ea9n m\u1ed9t c\u00e1ch r\u00f5 r\u00e0ng.",
    "If you still wish to continue and delete your account, please enter your account password:": "\u0391\u03bd \u03b5\u03be\u03b1\u03ba\u03bf\u03bb\u03bf\u03c5\u03b8\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03b8\u03ad\u03bb\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c7\u03c9\u03c1\u03ae\u03c3\u03b5\u03c4\u03b5 \u03c3\u03c4\u03b7 \u03b4\u03b9\u03b1\u03b3\u03c1\u03b1\u03c6\u03ae \u03c4\u03bf\u03c5 \u03bb\u03bf\u03b3\u03b1\u03c1\u03b9\u03b1\u03c3\u03bc\u03bf\u03cd \u03c3\u03b1\u03c2, \u03c0\u03b1\u03c1\u03b1\u03ba\u03b1\u03bb\u03bf\u03cd\u03bc\u03b5 \u03b5\u03b9\u03c3\u03ac\u03b3\u03b5\u03c4\u03b5 \u03c4\u03bf\u03bd \u03ba\u03c9\u03b4\u03b9\u03ba\u03cc \u03c3\u03b1\u03c2:",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "N\u1ebfu b\u1ea1n s\u1eed d\u1ee5ng b\u1ed9 so\u1ea1n th\u1ea3o cao c\u1ea5p, b\u00e0i t\u1eadp n\u00e0y s\u1ebd \u0111\u01b0\u1ee3c chuy\u1ec3n sang \u0111\u1ecbnh d\u1ea1ng XML v\u00e0 b\u1ea1n s\u1ebd kh\u00f4ng th\u1ec3 quay tr\u1edf l\u1ea1i b\u1ed9 so\u1ea1n th\u1ea3o \u0111\u01a1n gi\u1ea3n \u0111\u01b0\u1ee3c n\u1eefa.\n\nB\u1ea1n c\u00f3 mu\u1ed1n s\u1eed d\u1ee5ng b\u1ed9 so\u1ea1n th\u1ea3o cao c\u1ea5p v\u00e0 chuy\u1ec3n \u0111\u1ecbnh d\u1ea1ng b\u00e0i t\u1eadp th\u00e0nh XML?",
