    "The minimum score percentage must be a whole number between 0 and 100.": "T\u1ec9 l\u1ec7 \u0111i\u1ec3m s\u1ed1 ph\u1ea3i l\u00e0 con s\u1ed1 trong kho\u1ea3ng t\u1eeb 0 \u0111\u1ebfn 100",
