    "This response could not be marked as endorsed. Refresh the page and try again.": "C\u00e2u tr\u1ea3 l\u1eddi n\u00e0y kh\u00f4ng th\u1ec3 \u0111\u00e1nh d\u1ea5u l\u00e0 \u0111\u01b0\u1ee3c x\u00e1c nh\u1eadn. T\u1ea3i l\u1ea1i trang v\u00e0 th\u1eed l\u1ea1i.",
    "This response could not be saved.": "\u0397 \u03b1\u03c0\u03ac\u03bd\u03c4\u03b7\u03c3\u03b7 \u03b4\u03b5\u03bd \u03bc\u03c0\u03cc\u03c1\u03b5\u03c3\u03b5 \u03bd\u03b1 \u03b1\u03c0\u03bf\u03b8\u03b7\u03ba\u03b5\u03c5\u03c4\u03b5\u03af.",
    "This response could not be submitted.": "\u0397 \u03b1\u03c0\u03ac\u03bd\u03c4\u03b7\u03c3\u03ae \u03c3\u03b1\u03c2 \u03b4\u03b5\u03bd \u03bc\u03c0\u03cc\u03c1\u03b5\u03c3\u03b5 \u03bd\u03b1 \u03ba\u03b1\u03c4\u03b1\u03c7\u03c9\u03c1\u03b7\u03b8\u03b5\u03af.",
    "This response could not be unendorsed. Refresh the page and try again.": "Kh\u00f4ng th\u1ec3 kh\u00f4ng x\u00e1c nh\u1eadn c\u00e2u tr\u1ea3 l\u1eddi n\u00e0y. T\u1ea3i l\u1ea1i trang v\u00e0 th\u1eed l\u1ea1i.",
    "This response could not be unmarked as an answer. Refresh the page and try again.": "Kh\u00f4ng th\u1ec3 b\u1ecf \u0111\u00e1nh d\u1ea5u c\u00e2u tr\u1ea3 l\u1eddi n\u00e0y l\u00e0 m\u1ed9t c\u00e2u tr\u1ea3 l\u1eddi. T\u1ea3i l\u1ea1i trang v\u00e0 th\u1eed l\u1ea1i.",
    "This response has been saved but not submitted.": "\u0397 \u0395\u03a1\u0393\u0391\u03a3\u0399\u0391 \u03a3\u0391\u03a3 \u0395\u03a7\u0395\u0399 \u0391\u03a0\u039f\u0398\u0397\u039a\u0395\u03a5\u03a4\u0395\u0399 \u0391\u039b\u039b\u0391 \u0394\u0395\u039d \u0395\u03a7\u0395\u0399 \u03a5\u03a0\u039f\u0392\u039b\u0397\u0398\u0395\u0399.",
    "This response has not been saved.": "\u0394\u0395\u039d \u0395\u03a7\u0395\u03a4\u0395 \u0391\u03a0\u039f\u0398\u0397\u039a\u0395\u03a5\u03a3\u0395\u0399 \u03a4\u0397\u039d \u0395\u03a1\u0393\u0391\u03a3\u0399\u0391 \u03a3\u0391\u03a3.",
    "This role requires a divided discussions scheme.": "Vai tr\u00f2 n\u00e0y \u0111\u00f2i h\u1ecfi m\u1ed9t k\u1ebf ho\u1ea1ch th\u1ea3o lu\u1eadn nh\u00f3m.",
    "This section could not be loaded.": "\u0397 \u03b5\u03bd\u03cc\u03c4\u03b7\u03c4\u03b1 \u03b1\u03c5\u03c4\u03ae \u03b4\u03b5\u03bd \u03bc\u03c0\u03cc\u03c1\u03b5\u03c3\u03b5 \u03bd\u03b1 \u03bc\u03b5\u03c4\u03b1\u03c6\u03bf\u03c1\u03c4\u03c9\u03b8\u03b5\u03af.",
    "This short name for the assignment type (for example, HW or Midterm) appears next to assignments on a learner's Progress page.": "T\u00ean ng\u1eafn cho lo\u1ea1i b\u00e0i t\u1eadp (v\u00ed d\u1ee5: BTVN ho\u1eb7c KTra) xu\u1ea5t hi\u1ec7n b\u00ean c\u1ea1nh c\u00e1c b\u00e0i t\u1eadp tr\u00ean trang Ti\u1ebfn \u0111\u1ed9 c\u1ee7a ng\u01b0\u1eddi h\u1ecdc.",
    "This special exam has been released to learners. You may not convert it to another type of special exam. You may revert this subsection back to being a basic exam by selecting 'None', but you will NOT be able to configure it as a special exam in the future.": "K\u1ef3 thi \u0111\u1eb7c bi\u1ec7t n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c ph\u00e1t h\u00e0nh cho ng\u01b0\u1eddi h\u1ecdc. B\u1ea1n kh\u00f4ng th\u1ec3 chuy\u1ec3n \u0111\u1ed5i n\u00f3 sang m\u1ed9t lo\u1ea1i b\u00e0i ki\u1ec3m tra \u0111\u1eb7c bi\u1ec7t kh\u00e1c. B\u1ea1n c\u00f3 th\u1ec3 ho\u00e0n nguy\u00ean ti\u1ec3u m\u1ee5c n\u00e0y tr\u1edf l\u1ea1i th\u00e0nh m\u1ed9t b\u00e0i ki\u1ec3m tra c\u01a1 b\u1ea3n b\u1eb1ng c\u00e1ch ch\u1ecdn 'Kh\u00f4ng c\u00f3', nh\u01b0ng b\u1ea1n s\u1ebd KH\u00d4NG th\u1ec3 \u0111\u1ecbnh c\u1ea5u h\u00ecnh n\u00f3 nh\u01b0 m\u1ed9t b\u00e0i ki\u1ec3m tra \u0111\u1eb7c bi\u1ec7t trong t\u01b0\u01a1ng lai.",
    "This subsection was released to learners as a special exam, but was reverted back to a basic exam. You may not configure it as a special exam now. Contact edX Support for assistance.": "Ti\u1ec3u m\u1ee5c n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c ph\u00e1t h\u00e0nh cho ng\u01b0\u1eddi h\u1ecdc nh\u01b0 m\u1ed9t k\u1ef3 thi \u0111\u1eb7c bi\u1ec7t, nh\u01b0ng \u0111\u00e3 \u0111\u01b0\u1ee3c ho\u00e0n nguy\u00ean tr\u1edf l\u1ea1i k\u1ef3 thi c\u01a1 b\u1ea3n. B\u1ea1n kh\u00f4ng th\u1ec3 \u0111\u1ecbnh c\u1ea5u h\u00ecnh n\u00f3 nh\u01b0 m\u1ed9t k\u1ef3 thi \u0111\u1eb7c bi\u1ec7t ngay b\u00e2y gi\u1edd. Li\u00ean h\u1ec7 v\u1edbi B\u1ed9 ph\u1eadn h\u1ed7 tr\u1ee3 edX \u0111\u1ec3 \u0111\u01b0\u1ee3c h\u1ed7 tr\u1ee3.",
    "This team does not have any members.": "Nh\u00f3m n\u00e0y kh\u00f4ng c\u00f3 b\u1ea5t k\u1ef3 th\u00e0nh vi\u00ean n\u00e0o.",
    "This team is full.": "Nh\u00f3m n\u00e0y \u0111\u00e3 \u0111\u1ee7 th\u00e0nh vi\u00ean.",
    "This thread is closed.": "Ch\u1ee7 \u0111\u1ec1 n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c \u0111\u00f3ng l\u1ea1i.",
    "This unit has validation issues.": "\u0110\u01a1n v\u1ecb n\u00e0y c\u00f3 c\u00e1c v\u1ea5n \u0111\u1ec1 x\u00e1c nh\u1eadn.",
    "This vote could not be processed. Refresh the page and try again.": "\u0397 \u03c8\u03ae\u03c6\u03bf\u03c2 \u03c3\u03b1\u03c2 \u03b4\u03b5\u03bd \u03bc\u03c0\u03cc\u03c1\u03b5\u03c3\u03b5 \u03bd\u03b1 \u03ba\u03b1\u03c4\u03b1\u03c7\u03c9\u03c1\u03b7\u03b8\u03b5\u03af. \u0391\u03bd\u03b1\u03bd\u03b5\u03ce\u03c3\u03c4\u03b5 \u03c4\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1 \u03ba\u03b1\u03b9 \u03c0\u03c1\u03bf\u03c3\u03c0\u03b1\u03b8\u03ae\u03c3\u03c4\u03b5 \u03be\u03b1\u03bd\u03ac",
