    "To be sure all students can access the video, we recommend providing both an .mp4 and a .webm version of your video. Click below to add a URL for another version. These URLs cannot be YouTube URLs. The first listed video that's compatible with the student's computer will play.": "\u0110\u1ec3 ch\u1eafc ch\u1eafn t\u1ea5t c\u1ea3 h\u1ecdc vi\u00ean c\u00f3 th\u1ec3 truy c\u1eadp v\u00e0o video, ch\u00fang t\u00f4i khuy\u00ean b\u1ea1n n\u00ean cung c\u1ea5p c\u1ea3 phi\u00ean b\u1ea3n .mp4 v\u00e0 .webm video c\u1ee7a b\u1ea1n. B\u1ea5m v\u00e0o b\u00ean d\u01b0\u1edbi \u0111\u1ec3 th\u00eam m\u1ed9t URL cho m\u1ed9t phi\u00ean b\u1ea3n kh\u00e1c. Nh\u1eefng URL n\u00e0y kh\u00f4ng th\u1ec3 l\u00e0 URL tr\u00ean YouTube. Video \u0111\u1ea7u ti\u00ean \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea t\u01b0\u01a1ng th\u00edch v\u1edbi m\u00e1y t\u00ednh c\u1ee7a h\u1ecdc vi\u00ean s\u1ebd \u0111\u01b0\u1ee3c ph\u00e1t.",
    "To complete the program, you must earn a verified certificate for each course.": "\u0110\u1ec3 ho\u00e0n th\u00e0nh ch\u01b0\u01a1ng tr\u00ecnh, b\u1ea1n ph\u1ea3i ki\u1ebfm \u0111\u01b0\u1ee3c ch\u1ee9ng ch\u1ec9 \u0111\u00e3 \u0111\u01b0\u1ee3c x\u00e1c minh cho m\u1ed7i kh\u00f3a h\u1ecdc.",
    "To continue learning with this account, sign in below.": "\u0110\u1ec3 ti\u1ebfp t\u1ee5c h\u1ecdc v\u1edbi t\u00e0i kho\u1ea3n n\u00e0y, h\u00e3y \u0111\u0103ng nh\u1eadp b\u00ean d\u01b0\u1edbi.",
    "To invalidate a certificate for a particular learner, add the username or email address below.": "\u0110\u1ec3 l\u00e0m m\u1ea5t hi\u1ec7u l\u1ef1c ch\u1ee9ng ch\u1ec9 cho m\u1ed9t ng\u01b0\u1eddi h\u1ecdc c\u1ee5 th\u1ec3, h\u00e3y th\u00eam t\u00ean ng\u01b0\u1eddi d\u00f9ng ho\u1eb7c \u0111\u1ecba ch\u1ec9 email b\u00ean d\u01b0\u1edbi.",
    "To receive a certificate, you must also verify your identity before {date}.": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c ch\u1ee9ng ch\u1ec9, b\u1ea1n c\u0169ng ph\u1ea3i x\u00e1c minh danh t\u00ednh c\u1ee7a m\u00ecnh tr\u01b0\u1edbc {date}.",
    "To receive a certificate, you must also verify your identity.": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c ch\u1ee9ng ch\u1ec9, b\u1ea1n c\u0169ng ph\u1ea3i x\u00e1c minh danh t\u00ednh c\u1ee7a m\u00ecnh.",
    "To receive credit for problems, you must select \"Submit\" for each problem before you select \"End My Exam\".": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c t\u00edn ch\u1ec9 cho c\u00e1c v\u1ea5n \u0111\u1ec1, b\u1ea1n ph\u1ea3i ch\u1ecdn \"G\u1eedi\" cho t\u1eebng v\u1ea5n \u0111\u1ec1 tr\u01b0\u1edbc khi b\u1ea1n ch\u1ecdn \"K\u1ebft th\u00fac B\u00e0i ki\u1ec3m tra c\u1ee7a t\u00f4i\".",
    "To review learner cohort assignments or see the results of uploading a CSV file, download course profile information or cohort results on the {link_start}Data Download{link_end} page.": "\u0110\u1ec3 xem l\u1ea1i b\u00e0i t\u1eadp theo nh\u00f3m ng\u01b0\u1eddi h\u1ecdc ho\u1eb7c xem k\u1ebft qu\u1ea3 t\u1ea3i l\u00ean t\u1ec7p CSV, h\u00e3y t\u1ea3i xu\u1ed1ng th\u00f4ng tin h\u1ed3 s\u01a1 kh\u00f3a h\u1ecdc ho\u1eb7c k\u1ebft qu\u1ea3 nh\u00f3m thu\u1ea7n t\u1eadp tr\u00ean trang {link_start} T\u1ea3i xu\u1ed1ng d\u1eef li\u1ec7u {link_end} .",
