    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "S\u1eed d\u1ee5ng m\u1ed9t b\u00e0i thi t\u1eadp luy\u1ec7n gi\u00e1m s\u00e1t \u0111\u1ec3 gi\u1edbi thi\u1ec7u t\u1edbi ng\u01b0\u1eddi h\u1ecdc c\u00e1c c\u00f4ng c\u1ee5 v\u00e0 quy tr\u00ecnh gi\u00e1m s\u00e1t. K\u1ebft qu\u1ea3 thi t\u1eadp luy\u1ec7n kh\u00f4ng \u1ea3nh h\u01b0\u1edfng \u0111\u1ebfn \u0111i\u1ec3m s\u1ed1 c\u1ee7a ng\u01b0\u1eddi h\u1ecdc.",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "S\u1eed d\u1ee5ng b\u00e0i thi c\u00f3 th\u1eddi gian \u0111\u1ec3 gi\u1edbi h\u1ea1n th\u1eddi gian ng\u01b0\u1eddi h\u1ecdc l\u00e0m b\u00e0i trong ph\u1ea7n con n\u00e0y. Ng\u01b0\u1eddi h\u1ecdc ph\u1ea3i n\u1ed9p c\u00e2u tr\u1ea3 l\u1eddi tr\u01b0\u1edbc khi h\u1ebft h\u1ea1n. B\u1ea1n c\u00f3 th\u1ec3 cho ph\u00e9p th\u00eam th\u1eddi gian cho ng\u01b0\u1eddi h\u1ecdc c\u00e1 nh\u00e2n th\u00f4ng qua B\u1ea3ng th\u00f4ng tin Gi\u1ea3ng vi\u00ean.",
    "Use as a Prerequisite": "S\u1eed d\u1ee5ng nh\u01b0 y\u00eau c\u1ea7u b\u0103t bu\u1ed9c",
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, click \"Bookmark this page\" under the page title.": "\u03a7\u03c1\u03b7\u03c3\u03b9\u03bc\u03bf\u03c0\u03bf\u03b9\u03ae\u03c3\u03c4\u03b5 \u03c4\u03bf\u03c5\u03c2 \u03c3\u03b5\u03bb\u03b9\u03b4\u03bf\u03b4\u03b5\u03af\u03ba\u03c4\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03bc\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03b5\u03cd\u03ba\u03bf\u03bb\u03b1 \u03ba\u03b1\u03b9 \u03b3\u03c1\u03ae\u03b3\u03bf\u03c1\u03b1 \u03bd\u03b1 \u03bc\u03b5\u03c4\u03b1\u03b2\u03b5\u03af\u03c4\u03b5 \u03c3\u03b5 \u03c3\u03b5\u03bb\u03af\u03b4\u03b5\u03c2 \u03c4\u03bf\u03c5 \u03bc\u03b1\u03b8\u03ae\u03bc\u03b1\u03c4\u03bf\u03c2 \u03c0\u03bf\u03c5 \u03c3\u03b1\u03c2 \u03b5\u03bd\u03b4\u03b9\u03b1\u03c6\u03ad\u03c1\u03bf\u03c5\u03bd. \u0393\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03b8\u03ad\u03c3\u03b5\u03c4\u03b5 \u03c3\u03b5\u03bb\u03b9\u03b4\u03bf\u03b4\u03b5\u03af\u03ba\u03c4\u03b7 \u03c3\u03b5 \u03bc\u03af\u03b1 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1, \u03ba\u03ac\u03bd\u03c4\u03b5 \u03ba\u03bb\u03b9\u03ba \u03c3\u03c4\u03bf \u03ba\u03bf\u03c5\u03bc\u03c0\u03af \"\u03a0\u03c1\u03bf\u03c3\u03b8\u03ad\u03c3\u03c4\u03b5 \u03c3\u03b5\u03bb\u03b9\u03b4\u03bf\u03b4\u03b5\u03af\u03ba\u03c4\u03b7 \u03c3\u03b5 \u03b1\u03c5\u03c4\u03ae \u03c4\u03b7 \u03c3\u03b5\u03bb\u03af\u03b4\u03b1\" \u03c0\u03bf\u03c5 \u03b8\u03b1 \u03b2\u03c1\u03b5\u03af\u03c4\u03b5 \u03ba\u03ac\u03c4\u03c9 \u03b1\u03c0\u03cc \u03c4\u03bf\u03bd \u03c4\u03af\u03c4\u03bb\u03bf \u03c4\u03b7\u03c2.",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "S\u1eed d\u1ee5ng c\u00e1c nh\u00f3m l\u00e0m c\u01a1 s\u1edf \u0111\u1ec3 chia s\u1ebb c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn. T\u1ea5t c\u1ea3 ng\u01b0\u1eddi h\u1ecdc, kh\u00f4ng ph\u00e2n bi\u1ec7t nh\u00f3m, xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn gi\u1ed1ng nhau, nh\u01b0ng trong c\u00e1c ch\u1ee7 \u0111\u1ec1 chia s\u1ebb, ch\u1ec9 nh\u1eefng th\u00e0nh vi\u00ean c\u1ee7a c\u00f9ng m\u1ed9t nh\u00f3m m\u1edbi th\u1ea5y v\u00e0 tr\u1ea3 l\u1eddi c\u00e1c b\u00e0i \u0111\u0103ng c\u1ee7a nhau.",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "S\u1eed d\u1ee5ng c\u00e1c ki\u1ec3u \u0111\u0103ng k\u00fd l\u00e0m c\u01a1 s\u1edf \u0111\u1ec3 ph\u00e2n chia c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn. T\u1ea5t c\u1ea3 h\u1ecdc vi\u00ean, b\u1ea5t k\u1ec3 ki\u1ec3u \u0111\u0103ng k\u00fd c\u1ee7a h\u1ecd, xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn gi\u1ed1ng nhau, nh\u01b0ng trong c\u00e1c ch\u1ee7 \u0111\u1ec1 \u0111\u00e3 ph\u00e2n chia, ch\u1ec9 nh\u1eefng h\u1ecdc vi\u00ean trong c\u00f9ng m\u1ed9t ki\u1ec3u \u0111\u0103ng k\u00fd m\u1edbi nh\u00ecn th\u1ea5y v\u00e0 tr\u1ea3 l\u1eddi c\u00e1c b\u00e0i vi\u1ebft c\u1ee7a nhau.",
    "Use my institution/campus credentials": "S\u1eed d\u1ee5ng th\u00f4ng tin \u0111\u0103ng nh\u1eadp c\u01a1 s\u1edf / t\u1ed5 ch\u1ee9c c\u1ee7a t\u00f4i",
    "Use my university info": "S\u1eed d\u1ee5ng th\u00f4ng tin tr\u01b0\u1eddng \u0111\u1ea1i h\u1ecdc c\u1ee7a t\u00f4i",
    "Use the All Topics menu to find specific topics.": "\u039a\u03ac\u03bd\u03c4\u03b5 \u03ba\u03bb\u03b9\u03ba \u03c3\u03c4\u03bf \u03ba\u03bf\u03c5\u03bc\u03c0\u03af \"\u038c\u03bb\u03b5\u03c2 \u03bf\u03b9 \u03b1\u03bd\u03b1\u03c1\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2\" \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03b4\u03b5\u03af\u03c4\u03b5 \u03cc\u03bb\u03b1 \u03c4\u03b1 \u03b1\u03bd\u03b1\u03c1\u03c4\u03b7\u03bc\u03ad\u03bd\u03b1 \u03bd\u03ae\u03bc\u03b1\u03c4\u03b1.",
