    "What does this mean?": "\u0110i\u1ec1u n\u00e0y c\u00f3 ngh\u0129a l\u00e0 g\u00ec?",
    "What if I can't see the camera image, or if I can't see my photo do determine which side is visible?": "\u0110i\u1ec1u g\u00ec s\u1ebd x\u1ea3y ra n\u1ebfu t\u00f4i kh\u00f4ng th\u1ec3 nh\u00ecn th\u1ea5y h\u00ecnh \u1ea3nh m\u00e1y \u1ea3nh ho\u1eb7c n\u1ebfu t\u00f4i kh\u00f4ng th\u1ec3 nh\u00ecn th\u1ea5y \u1ea3nh c\u1ee7a m\u00ecnh, h\u00e3y x\u00e1c \u0111\u1ecbnh xem b\u00ean n\u00e0o c\u00f3 th\u1ec3 nh\u00ecn th\u1ea5y?",
    "What if I have difficulty holding my ID in position relative to the camera?": "\u0110i\u1ec1u g\u00ec s\u1ebd x\u1ea3y ra n\u1ebfu t\u00f4i g\u1eb7p kh\u00f3 kh\u0103n khi gi\u1eef ID c\u1ee7a m\u00ecnh \u1edf v\u1ecb tr\u00ed so v\u1edbi m\u00e1y \u1ea3nh?",
    "What if I have difficulty holding my head in position relative to the camera?": "\u0110i\u1ec1u g\u00ec s\u1ebd x\u1ea3y ra n\u1ebfu t\u00f4i g\u1eb7p kh\u00f3 kh\u0103n khi gi\u1eef \u0111\u1ea7u \u1edf v\u1ecb tr\u00ed so v\u1edbi m\u00e1y \u1ea3nh?",
    "What industry do you currently work in?": "B\u1ea1n hi\u1ec7n \u0111ang l\u00e0m vi\u1ec7c trong ng\u00e0nh g\u00ec?",
    "What industry do you want to work in?": "B\u1ea1n mu\u1ed1n l\u00e0m vi\u1ec7c trong ng\u00e0nh n\u00e0o?",
    "What is the highest level of education that any of your parents or guardians have achieved?": "Tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n cao nh\u1ea5t m\u00e0 b\u1ea5t k\u1ef3 cha m\u1eb9 ho\u1eb7c ng\u01b0\u1eddi gi\u00e1m h\u1ed9 n\u00e0o c\u1ee7a b\u1ea1n \u0111\u00e3 \u0111\u1ea1t \u0111\u01b0\u1ee3c?",
    "What is the highest level of education that you have achieved so far?": "Tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n cao nh\u1ea5t m\u00e0 b\u1ea1n \u0111\u00e3 \u0111\u1ea1t \u0111\u01b0\u1ee3c cho \u0111\u1ebfn nay l\u00e0 g\u00ec?",
    "What was the total combined income, during the last 12 months, of all members of your family? ": "T\u1ed5ng thu nh\u1eadp t\u1ed5ng h\u1ee3p, trong 12 th\u00e1ng qua, c\u1ee7a t\u1ea5t c\u1ea3 c\u00e1c th\u00e0nh vi\u00ean trong gia \u0111\u00ecnh b\u1ea1n l\u00e0 bao nhi\u00eau?",
    "What's Your Next Accomplishment?": "Th\u00e0nh t\u1ef1u ti\u1ebfp theo c\u1ee7a b\u1ea1n l\u00e0 g\u00ec?",
    "When learners submit an answer to an assessment, they immediately see whether the answer is correct or incorrect, and the score received.": "Khi h\u1ecdc vi\u00ean g\u1eedi c\u00e2u tr\u1ea3 l\u1eddi cho m\u1ed9t b\u00e0i \u0111\u00e1nh gi\u00e1, h\u1ecd s\u1ebd ngay l\u1eadp t\u1ee9c \u0111\u01b0\u1ee3c xem c\u00e2u tr\u1ea3 l\u1eddi l\u00e0 ch\u00ednh x\u00e1c hay kh\u00f4ng, v\u00e0 \u0111i\u1ec3m s\u1ed1 nh\u1eadn \u0111\u01b0\u1ee3c.",
    "When your face is in position, use the Take Photo button {icon} below to take your photo.": "Khi khu\u00f4n m\u1eb7t c\u1ee7a b\u1ea1n \u0111\u00e3 \u1edf \u0111\u00fang v\u1ecb tr\u00ed, h\u00e3y s\u1eed d\u1ee5ng n\u00fat Ch\u1ee5p \u1ea3nh {icon} b\u00ean d\u01b0\u1edbi \u0111\u1ec3 ch\u1ee5p \u1ea3nh.",
    "Which timed transcript would you like to use?": "B\u1ea1n mu\u1ed1n s\u1eed d\u1ee5ng b\u1ea3n d\u1ecbch n\u00e0o?",
    "While our support team is happy to assist with the edX platform, the course staff has the expertise for specific assignment questions, grading or the proper procedures in each course. Please post all course related questions within the Discussion Forum where the Course Staff can directly respond.": "M\u1eb7c d\u00f9 nh\u00f3m h\u1ed7 tr\u1ee3 c\u1ee7a ch\u00fang t\u00f4i r\u1ea5t s\u1eb5n l\u00f2ng h\u1ed7 tr\u1ee3 n\u1ec1n t\u1ea3ng edX, \u0111\u1ed9i ng\u0169 nh\u00e2n s\u1ef1 c\u00f3 chuy\u00ean m\u00f4n v\u1ec1 c\u00e1c c\u00e2u h\u1ecfi b\u00e0i t\u1eadp c\u1ee5 th\u1ec3, c\u00e1ch ch\u1ea5m \u0111i\u1ec3m ho\u1eb7c c\u00e1c quy tr\u00ecnh th\u00edch h\u1ee3p trong m\u1ed7i kh\u00f3a h\u1ecdc. Vui l\u00f2ng \u0111\u0103ng t\u1ea5t c\u1ea3 c\u00e1c c\u00e2u h\u1ecfi li\u00ean quan \u0111\u1ebfn kh\u00f3a h\u1ecdc trong Di\u1ec5n \u0111\u00e0n th\u1ea3o lu\u1eadn n\u01a1i \u0110\u1ed9i ng\u0169 nh\u00e2n s\u1ef1 c\u00f3 th\u1ec3 tr\u1ef1c ti\u1ebfp tr\u1ea3 l\u1eddi.",
