    "Your changes have been saved.": "\u039f\u03b9 \u03b1\u03bb\u03bb\u03b1\u03b3\u03ad\u03c2 \u03c3\u03b1\u03c2 \u03b1\u03c0\u03bf\u03b8\u03b7\u03ba\u03b5\u03cd\u03c4\u03b7\u03ba\u03b1\u03bd.",
    "Your changes have been saved. {details}": "\u039f\u03b9 \u03b1\u03bb\u03bb\u03b1\u03b3\u03ad\u03c2 \u03c3\u03b1\u03c2 \u03b1\u03c0\u03bf\u03b8\u03b7\u03ba\u03b5\u03cd\u03c4\u03b7\u03ba\u03b1\u03bd.  {details}",
    "Your changes will not take effect until you save your progress.": "Thay \u0111\u1ed5i c\u1ee7a b\u1ea1n s\u1ebd kh\u00f4ng c\u00f3 hi\u1ec7u l\u1ef1c cho \u0111\u1ebfn khi b\u1ea1n l\u01b0u l\u1ea1i ti\u1ebfn \u0111\u1ed9 c\u1ee7a m\u00ecnh.",
    "Your changes will not take effect until you save your progress. Take care with key and value formatting, as validation is not implemented.": "C\u00e1c thay \u0111\u1ed5i s\u1ebd kh\u00f4ng c\u00f3 hi\u1ec7u l\u1ef1c cho \u0111\u1ebfn khi b\u1ea1n l\u01b0u ti\u1ebfn tr\u00ecnh c\u1ee7a b\u1ea1n. H\u00e3y c\u1ea9n th\u1eadn v\u1edbi key v\u00e0 \u0111\u1ecbnh d\u1ea1ng c\u1ee7a gi\u00e1 tr\u1ecb, b\u1edfi v\u00ec s\u1ef1 x\u00e1c nh\u1eadn ch\u01b0a \u0111\u01b0\u1ee3c ho\u00e0n th\u00e0nh.",
    "Your course could not be exported to XML. There is not enough information to identify the failed component. Inspect your course to identify any problematic components and try again.": "Kh\u00f4ng th\u1ec3 xu\u1ea5t kho\u00e1 h\u1ecdc c\u1ee7a b\u1ea1n sang t\u1ec7p XML. Kh\u00f4ng c\u00f3 \u0111\u1ee7 th\u00f4ng tin \u0111\u1ec3 t\u00ecm ra ph\u1ea7n b\u1ecb l\u1ed7i. B\u1ea1n n\u00ean ki\u1ec3m tra l\u1ea1i kho\u00e1 h\u1ecdc c\u1ee7a b\u1ea1n \u0111\u1ec3 t\u00ecm ra ph\u1ea7n b\u1ecb l\u1ed7i v\u00e0 th\u1eed l\u1ea1i.",
    "Your donation could not be submitted.": "S\u1ed1 ti\u1ec1n t\u00e0i tr\u1ee3 c\u1ee7a b\u1ea1n kh\u00f4ng g\u1eedi \u0111\u01b0\u1ee3c.",
    "Your email message was successfully queued for sending. In courses with a large number of learners, email messages to learners might take up to an hour to be sent.": "Email c\u1ee7a b\u1ea1n \u0111\u00e3 \u0111\u01b0\u1ee3c x\u1ebfp h\u00e0ng \u0111\u1ee3i \u0111\u1ec3 g\u1eedi. V\u1edbi nh\u1eefng kh\u00f3a h\u1ecdc c\u00f3 nhi\u1ec1u ng\u01b0\u1eddi h\u1ecdc, th\u01b0 \u0111i\u1ec7n t\u1eed g\u1eedi cho ng\u01b0\u1eddi h\u1ecdc c\u00f3 th\u1ec3 m\u1ea5t \u0111\u1ebfn m\u1ed9t gi\u1edd \u0111\u1ec3 \u0111\u01b0\u1ee3c g\u1eedi \u0111i.",
    "Your entire face fits inside the frame.": "To\u00e0n b\u1ed9 khu\u00f4n m\u1eb7t c\u1ee7a b\u1ea1n ph\u00f9 h\u1ee3p v\u1edbi b\u00ean trong khung.",
