    "Your file '{file}' has been uploaded. Allow a few minutes for processing.": "T\u1ec7p tin '{file}' c\u1ee7a b\u1ea1n \u0111\u00e3 \u0111\u01b0\u1ee3c t\u1ea3i l\u00ean. Xin ch\u1edd m\u1ed9t v\u00e0i ph\u00fat \u0111\u1ec3 x\u1eed l\u00fd.",
